const formProps = {
  email: {
    name: "email",
    placeholder: "Адрес электронной почты",
    placeholderTextColor: "#BDBDBD",
  },
  password: {
    name: "password",
    placeholder: "Пароль",
    placeholderTextColor: "#BDBDBD",
  },
};

export default formProps;
